// src/components/TaskForm.js
import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  // Hapus Container dari import di sini
  TextField,
  Button,
  MenuItem,
  Box,
  Typography,
  Paper,
} from "@mui/material";

const TaskForm = () => {
  const [supportTypes, setSupportTypes] = useState([]);
  const [applications, setApplications] = useState([]);
  const [sqiPics, setSqiPics] = useState([]);
  const [form, setForm] = useState({
    title: "",
    supportType: "",
    description: "",
    applicationId: "",
    sqiPicId: "",
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [supportRes, appRes, picRes] = await Promise.all([
          axios.get("http://localhost:4000/api/support-types", {
            headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
          }),
          axios.get("http://localhost:4000/api/applications", {
            headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
          }),
          axios.get("http://localhost:4000/api/sqi-pics", {
            headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
          }),
        ]);

        setSupportTypes(supportRes.data);
        setApplications(appRes.data);
        setSqiPics(picRes.data);
      } catch (err) {
        console.error("Gagal mengambil data dropdown:", err);
        // Mengganti alert dengan console.error karena alert() tidak diizinkan
        console.error("Gagal memuat data. Pastikan Anda sudah login.");
      }
    };
    fetchData();
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log(form);
    // Kirim data ke API atau logika submit
  };

  return (
    // HAPUS Container. Terapkan styling centering langsung pada Paper.
    <Paper 
        elevation={3} 
        sx={{ 
            p: 4, 
            borderRadius: 3, 
            mt: 5,
            width: '100%',     // Pastikan mengambil lebar penuh dari wadah Flex
            maxWidth: 600,    // Batasi form agar tidak terlalu lebar
            mx: 'auto',       // Center form secara horizontal di dalam Flex container
            boxShadow: 3,     // Tambahkan sedikit bayangan agar form terlihat menonjol
        }}
    >
      <Typography variant="h5" gutterBottom>
        Tambah Task Baru
      </Typography>
      <Box component="form" onSubmit={handleSubmit}>
        {/* 1. Judul Task */}
        <TextField
          fullWidth
          label="Judul Task"
          name="title"
          value={form.title}
          onChange={handleChange}
          margin="normal"
          required
        />

        {/* 2. Bentuk Support */}
        <TextField
          select
          fullWidth
          label="Bentuk Support"
          name="supportType"
          value={form.supportType}
          onChange={handleChange}
          margin="normal"
          required
        >
          {supportTypes.map((type) => (
            <MenuItem key={type.id} value={type.name}>
              {type.name}
            </MenuItem>
          ))}
          <MenuItem value="Other">Other</MenuItem>
        </TextField>

        {/* 3. Aplikasi */}
        <TextField
          select
          fullWidth
          label="Aplikasi"
          name="applicationId"
          value={form.applicationId}
          onChange={handleChange}
          margin="normal"
          required
        >
          {applications.map((app) => (
            <MenuItem key={app.id} value={app.id}>
              {app.name}
            </MenuItem>
          ))}
        </TextField>

        {/* 4. Deskripsi */}
        <TextField
          fullWidth
          label="Deskripsi"
          name="description"
          value={form.description}
          onChange={handleChange}
          margin="normal"
          multiline
          rows={4}
          required
        />

        {/* 5. PIC SQI */}
        <TextField
          select
          fullWidth
          label="PIC SQI"
          name="sqiPicId"
          value={form.sqiPicId}
          onChange={handleChange}
          margin="normal"
          required
        >
          {sqiPics.map((pic) => (
            <MenuItem key={pic.id} value={pic.id}>
              {pic.name}
            </MenuItem>
          ))}
        </TextField>

        <Box sx={{ textAlign: "right" }}>
          <Button
            type="submit"
            variant="contained"
            color="primary"
            sx={{ mt: 3 }}
          >
            Simpan Task
          </Button>
        </Box>
      </Box>
    </Paper>
  );
};

export default TaskForm;
